import React from 'react';
import {Link, NavLink} from "react-router-dom";

const NavBar = () => {
    return (
        <nav className="navbar navbar-expand-sm navbar-dark bg-dark">

            <ul>
                <li><a href="./">Home</a></li>
                <li><a href="./about">about</a></li>
                <li><a href="./login">login</a></li>
            </ul>
        </nav>
    )
};

export default NavBar;
